function QuoteRow(props)
{
    return <tr>
                    <td>
                        {props.quote.id}
                    </td>
                    <td>
                        {props.quote.quote}
                    </td>
                    <td>
                    <button className='btn btn-danger'
                    onClick={()=>{
                     props.getQuotes(props.quote.id)
                    }}>
                    Add Favourite
                    </button>
                    </td>
           </tr>
}
export default QuoteRow;
